INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 40011, 2, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 321, 1, 24001, "リリ", 125801);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 40011, 2, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 322, 1, 24001, "クリア", 126001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 40011, 2, 3, "んーと。\nこれ、あげる。\nはい", 0, 323, 1, 24001, "プレシア", 126101);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 40011, 2, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 324, 1, 24001, "リリ", 125801);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 40011, 2, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 325, 1, 24001, "クリア", 126001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 40011, 2, 6, "お兄。\nきてくれて、うれしい", 0, 326, 1, 24001, "プレシア", 126101);
